import React from 'react';
import { Link, Redirect } from 'react-router-dom';
import Pusher from 'pusher-js'
import axios from 'axios'

class Navbar extends React.Component {
  constructor(props){
    super(props)
    this.onClick=this.onClick.bind(this)
    this.state={
      notifications: [],
    }
  }

  componentDidMount(){
    axios({
      method : 'GET',
      url : '/api/notifications',
      headers : {
        Authorization: "Bearer" + localStorage.getItem("userToken")
      },
    }).then(res => {
      this.setState({
        notifications : res.data.notifications,
      });
      console.log(this.state.notifications)
    })

    var pusher = new Pusher('713d7bdf9e0f17458630', {
      cluster: 'ap1'
    });
  
    var channel = pusher.subscribe('NotificationEvent');
    channel.bind('send-message', function(data) {
      console.log('a')
    });
  }

  onClick(e){
    localStorage.removeItem('userToken')
    localStorage.removeItem('userName')
    localStorage.removeItem('userId')
    window.location.reload("/")
  }

  handleKeyDown = (event) => {
    if(event.key === 'Enter'){
      event.preventDefault();
      window.location.replace('/search?p='+event.target.value)
    }
  }

  render(){
    const notifications = this.state.notifications ? this.state.notifications.map(res => {
      return <>
            <div className='nav-link' style= {{width : '200px', height: '100px',border:'1px'}}>
                
            </div>
            
      </>
  }) : <></>
  return (
  <nav className="topbar topbar-inverse topbar-expand-md topbar-sticky">
        <div className="container">
          <div className="topbar-left">
            <button className="topbar-toggler">â˜°</button>
            <Link className="topbar-brand" to="/">
              <img className="logo-default" src={`${process.env.PUBLIC_URL}/assets/img/logo.png`} alt="logo" />
              <img className="logo-inverse" src={`${process.env.PUBLIC_URL}/assets/img/logo-light.png`} alt="logo" />
            </Link>
            <div class="search__container">
                <input class="search__input" type="text" placeholder="Search"  onKeyPress={this.handleKeyDown}/>
            </div>
          </div>
          <div className="topbar-right">
            <ul className="topbar-nav nav">
              {localStorage.getItem("userToken") != null ? 
              <>
              <li className="nav-item">
              <Link className="nav-link" to="/">Home</Link>
              </li>
              <li className="nav-item">
              <Link className="nav-link" to="/post/create">Create</Link>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#"><i className="fa fa-globe" />
                  <i className="fa fa-caret-down" />
                </a>
                <div className="nav-submenu" style={{width : '200px', height: '500px'}}>
                <a className="nav-link" href="/user/profile">My Profile</a>
                  <a className="nav-link" href="/user/post">My Blog</a>
                  <a className="nav-link" onClick={this.onClick} href="/">Logout</a>
                </div>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">{localStorage.getItem("userName")}
                  <i className="fa fa-caret-down" />
                </a>
                <div className="nav-submenu">
                  <a className="nav-link" href="/user/profile">My Profile</a>
                  <a className="nav-link" href="/user/post">My Blog</a>
                  <a className="nav-link" onClick={this.onClick} href="/">Logout</a>
                </div>
              </li>
              </>
              : 
              <>
                <li className="nav-item">
                <Link className="nav-link" to="/login">Login</Link>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="/signup">Signup</a>
              </li>
              </>
              
              }
              
            </ul>
          </div>
        </div>
      </nav>
  );
  }
}

export default Navbar;
